"    <div id=\"topicTitle\">",
"     Patient information: Choosing birth control (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/choosing-birth-control-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H46966067\">",
"      <span class=\"h1\">",
"       What is birth control?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Birth control is a term used to describe ways to prevent pregnancy. Another word for birth control is &ldquo;contraception.&rdquo;",
"     </p>",
"     <p>",
"      Different types of birth control include medicines, devices, and procedures. Some types of birth control are used by women, and others are used by men. Some types need to be used every time a person has sex. Other types can prevent pregnancy for long periods of time. Some types need a doctor&rsquo;s prescription, and others do not.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46966074\">",
"      <span class=\"h1\">",
"       Which type of birth control should I choose?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Choosing birth control can be tough, because no birth control is perfect. Your doctor or nurse can help you choose the type that is right for you. To help you make a decision, think about:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        How well it prevents pregnancy &ndash; No birth control works 100 percent perfectly all the time, but some prevent pregnancy better than others.",
"       </li>",
"       <li>",
"        How often you have to use it &ndash; For example, women who use birth control pills must take them every day.",
"       </li>",
"       <li>",
"        How easy it is to use",
"       </li>",
"       <li>",
"        Its side effects or downsides",
"       </li>",
"       <li>",
"        Its cost",
"       </li>",
"       <li>",
"        If you want to get pregnant in the future &ndash; Some types of birth control are permanent, meaning they prevent you from ever getting pregnant. Other types of birth control prevent pregnancy only for a limited amount of time. After that time, you can still get pregnant. &nbsp;",
"       </li>",
"       <li>",
"        Whether it protects you from infection &ndash; Only male and female condoms can reduce your chance of getting certain infections called &ldquo;STDs&rdquo; (or sexually transmitted diseases).",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46966081\">",
"      <span class=\"h1\">",
"       What are the different types of birth control and how do they work?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Different types of birth control prevent pregnancy in different ways and have different levels of effectiveness (",
"      <a class=\"graphic graphic_figure graphicRef73238 \" href=\"UTD.htm?3/50/3876\">",
"       figure 1",
"      </a>",
"      and",
"      <a class=\"graphic graphic_figure graphicRef88535 \" href=\"UTD.htm?32/16/33032\">",
"       figure 2",
"      </a>",
"      ). Each of the main types is discussed in more detail elsewhere (",
"      <a class=\"graphic graphic_table graphicRef88695 \" href=\"UTD.htm?17/15/17660\">",
"       table 1",
"      </a>",
"      ). See:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <a class=\"medical medical_basics\" href=\"UTD.htm?18/17/18707?source=see_link\">",
"         Patient information: Hormonal birth control (The Basics)",
"        </a>",
"       </li>",
"       <li>",
"        <a class=\"medical medical_basics\" href=\"UTD.htm?36/17/37138?source=see_link\">",
"         Patient information: Intrauterine devices (IUD) (The Basics)",
"        </a>",
"       </li>",
"       <li>",
"        <a class=\"medical medical_basics\" href=\"UTD.htm?1/22/1378?source=see_link\">",
"         Patient information: Long-acting methods of birth control (The Basics)",
"        </a>",
"       </li>",
"       <li>",
"        <a class=\"medical medical_basics\" href=\"UTD.htm?12/28/12738?source=see_link\">",
"         Patient information: Emergency contraception (The Basics)",
"        </a>",
"       </li>",
"       <li>",
"        <a class=\"medical medical_basics\" href=\"UTD.htm?22/51/23346?source=see_link\">",
"         Patient information: Sterilization for women (The Basics)",
"        </a>",
"       </li>",
"       <li>",
"        <a class=\"medical medical_basics\" href=\"UTD.htm?35/25/36242?source=see_link\">",
"         Patient information: Vasectomy (The Basics)",
"        </a>",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5745320\">",
"      <span class=\"h1\">",
"       What about natural forms of birth control?",
"      </span>",
"      &nbsp;&mdash;&nbsp;There are a few forms of &ldquo;natural&rdquo; birth control, which require no medicines or devices. But they are not as effective as the other forms of birth control. Natural birth control methods include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Withdrawal &ndash; This is when the man pulls out before he ejaculates.",
"       </li>",
"       <li>",
"        Fertility awareness &ndash; This is when the woman keeps track of her menstrual cycle so she can predict when she is most likely to get pregnant. Then, she avoids sex during that time, or uses some form of birth control then, such as a condom.",
"       </li>",
"       <li>",
"        Breastfeeding &ndash; Breastfeeding can decrease a woman&rsquo;s ability to get pregnant. Some women use it as a form of birth control for the first few weeks after a baby is born. But for it to work, breast milk should be the baby&rsquo;s only food. The medical term for this method is &ldquo;lactational amenorrhea method,&rdquo; or &ldquo;LAM.&rdquo; If you decide to try this method, discuss it with your doctor or nurse.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46966088\">",
"      <span class=\"h1\">",
"       What if I have problems with my birth control?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Let your doctor or nurse know if you have any side effects or problems with your birth control. Sometimes, side effects will go away after a few months. If they don&rsquo;t, you might need to work with your doctor or nurse to find a different type of birth control.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H46966151\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?18/17/18707?source=see_link\">",
"       Patient information: Hormonal birth control (The Basics)",
"      </a>",
"      <br/>",
