"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     Neufeld HN, Schneeweiss A. Coronary Artery Disease in Infants and Children, Lea and Febiger, Philadelphia 1983.",
"    </li>",
