"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Uncommon",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Iritis/corneal ulcer",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Rare",
"       </td>",
"       <td>",
"        Unknown",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\">",
"        Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Metallic taste",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"       <td>",
"        Common",
"       </td>",
"      </tr>",
