var title_f13_56_14223="Immunization resources";
var content_f13_56_14223=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F82687&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F82687&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Online resources regarding vaccines and vaccine safety",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Organization/URL",
"       </td>",
"       <td class=\"subtitle1\">",
"        Description",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Professional organizations/societies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         American Academy of Family Physicians",
"        </p>",
"        <p>",
"         <a href=\"file://www.familydoctor.org\" target=\"_blank\">",
"          www.familydoctor.org",
"         </a>",
"         (search on \"vaccines\")",
"        </p>",
"       </td>",
"       <td>",
"        Patient information on childhood vaccines (what they are and why children need them)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         American Academy of Pediatrics Childhood Immunization Support Program",
"        </p>",
"        <p>",
"         <a href=\"file://www.aap.org/immunization\" target=\"_blank\">",
"          www.aap.org/immunization",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Compilation of resources for families and providers, including Q&amp;A for families and information on vaccine-preventable illnesses, vaccine ingredients, vaccine safety, and the immunization schedule",
"        </p>",
"        <p>",
"         Provides information for clinicians on how to communicate with parents about immunization, including responses for common reasons for parental refusal to vaccinate",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Canadian Pediatric Society",
"        </p>",
"        <p>",
"         <a href=\"file://www.caringforkids.cps.ca/\" target=\"_blank\">",
"          www.caringforkids.cps.ca/",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides a parent's guide to immunization information on the Internet",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Infectious Diseases Society of America (IDSA)",
"        </p>",
"        <p>",
"         <a href=\"file://www.idsociety.org\" target=\"_blank\">",
"          www.idsociety.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides lists of resources, IDSA position statements, and policy statements",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Group on Immunization Education, Society of Teachers and Family",
"        </p>",
"        <p>",
"         <a href=\"file://www.immunizationed.org\" target=\"_blank\">",
"          www.immunizationed.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides links to immunization information and resources, including an audio-recording of the pertussis cough in an infant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Academic institutions",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Center for Vaccine Awareness and Research, Texas Children's Hospital",
"        </p>",
"        <p>",
"         <a href=\"file://www.vaccine.texaschildrens.org\" target=\"_blank\">",
"          www.vaccine.texaschildrens.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides valuable information regarding vaccination. Includes links to resources, including a book that profiles families devastated by vaccine-preventable illness (for purchase).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Institute for Vaccine Safety, Johns Hopkins University",
"        </p>",
"        <p>",
"         <a href=\"file://www.vaccinesafety.edu\" target=\"_blank\">",
"          www.vaccinesafety.edu",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides an independent assessment of vaccines and vaccine safety to guide decision makers and educate physicians, the public, and the media about the safety of vaccines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         The Nemours Foundation KidsHealth",
"        </p>",
"        <p>",
"         <a href=\"file://kidshealth.org/teen/your_body/health_basics/immunizations.html\" target=\"_blank\">",
"          kidshealth.org/teen/your_body/health_basics/immunizations.html",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Vaccine information targeted to adolescents",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         The Vaccine Education Center at the Children's Hospital of Philadelphia",
"        </p>",
"        <p>",
"         <a href=\"file://www.vaccine.chop.edu\" target=\"_blank\">",
"          www.vaccine.chop.edu",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides reliable information about vaccines to parents and healthcare professionals",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Public health/advocacy groups",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Allied Vaccine Group",
"        </p>",
"        <p>",
"         <a href=\"file://www.vaccine.org\" target=\"_blank\">",
"          www.vaccine.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Links to Web sites dedicated to presenting valid scientific information about vaccines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Program for Appropriate Technology in Health (PATH) Vaccine Resource Library",
"        </p>",
"        <p>",
"         <a href=\"file://www.path.org/vaccineresources/\" target=\"_blank\">",
"          www.path.org/vaccineresources/",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Offers a variety of high-quality, scientifically accurate documents and links to information about vaccine-preventable diseases and vaccines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Every Child by Two",
"        </p>",
"        <p>",
"         <a href=\"file://www.ecbt.org\" target=\"_blank\">",
"          www.ecbt.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Seeks to raise parental awareness of the need for timely infant immunizations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Health on the Net Foundation",
"        </p>",
"        <p>",
"         <a href=\"file://www.hon.ch\" target=\"_blank\">",
"          www.hon.ch",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Nonprofit, nongovernmental organization that promotes and guides the deployment of useful and reliable online health information",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Immunization Action Coalition (IAC)",
"        </p>",
"        <p>",
"         <a href=\"file://www.immunize.org\" target=\"_blank\">",
"          www.immunize.org",
"         </a>",
"         (search on \"immunization safety\")",
"        </p>",
"       </td>",
"       <td>",
"        The IAC creates and distributes educational materials and facilitates communication about the safety, efficacy, and use of vaccines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Institute of Medicine (IOM)",
"        </p>",
"        <p>",
"         <a href=\"file://www.iom.edu\" target=\"_blank\">",
"          www.iom.edu",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Independent, nonprofit organization that works outside the government to provide unbiased and authoritative advice. Provides access to the IOM immunization safety reviews (eg, vaccines and autism, multiple immunizations and immune dysfunction, etc).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         National Alliance for Hispanic Health",
"        </p>",
"        <p>",
"         <a href=\"file://www.hispanichealth.org\" target=\"_blank\">",
"          www.hispanichealth.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Advocacy and research forum focused on Hispanic health and well-being. Provides links to information about vaccine-preventable disease and other health issues.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         National Foundation for Infectious Diseases",
"        </p>",
"        <p>",
"         <a href=\"file://www.nfid.org\" target=\"_blank\">",
"          www.nfid.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Nonprofit organization dedicated to educating the public and healthcare professionals about the causes, treatment, and prevention of infectious diseases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         National Meningitis Association",
"        </p>",
"        <p>",
"         <a href=\"file://www.nmaus.org\" target=\"_blank\">",
"          www.nmaus.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Nonprofit organization founded by parents whose children have died or have permanent disability from meningococcal disease. Includes links to educational materials, including a video featuring the stories of meningococcal disease survivors and families affected by the disease.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         National Network for Immunization Information",
"        </p>",
"        <p>",
"         <a href=\"file://www.immunizationinfo.org\" target=\"_blank\">",
"          www.immunizationinfo.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides science-based information to individuals who need to know the facts about immunization. Publishes a booklet with tips on how to find reliable immunization information on the Internet (for purchase).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         The Vaccine Page",
"        </p>",
"        <p>",
"         <a href=\"file://www.vaccines.org\" target=\"_blank\">",
"          www.vaccines.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides access to news about vaccines and annotated database of vaccine resources on the Internet; the vaccine page does not control the content of the news links and encourages readers to validate the news items through reputable resources (eg, the Allied Vaccine Group)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         World Health Organization",
"        </p>",
"        <p>",
"         <a href=\"file://www.who.int/topics/vaccines/en/\" target=\"_blank\">",
"          www.who.int/topics/vaccines/en/",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides links to information about immunization",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Vaccine Information You Need",
"        </p>",
"        <a href=\"file://www.vaccineinformation.org/\" target=\"_blank\">",
"         www.vaccineinformation.org",
"        </a>",
"       </td>",
"       <td>",
"        Provides information about vaccines and the diseases they prevent, including a video library",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Parent/family groups",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Families Fighting Flu",
"        </p>",
"        <p>",
"         <a href=\"file://www.familiesfightingflu.org\" target=\"_blank\">",
"          www.familiesfightingflu.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Nonprofit corporation dedicated to educating people about the severity of influenza and the importance of vaccinating children against the flu",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Parents of Kids with Infectious Diseases",
"        </p>",
"        <p>",
"         <a href=\"file://www.pkids.org/immunizations.php\" target=\"_blank\">",
"          www.pkids.org/immunizations.php",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides links to information about vaccines and vaccine safety",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Meningitis Angels",
"        </p>",
"        <p>",
"         <a href=\"file://www.meningitis-angels.org\" target=\"_blank\">",
"          www.meningitis-angels.org",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides education about bacterial meningitis and prevention of bacterial meningitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Government agencies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         United States Centers for Disease Control and Prevention",
"        </p>",
"        <p>",
"         <a href=\"file://www.cdc.gov/vaccines\" target=\"_blank\">",
"          www.cdc.gov/vaccines",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides information and links about vaccines and vaccine-preventable diseases",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         US Food and Drug Administration",
"        </p>",
"        <p>",
"         <a href=\"file://www.fda.gov/cber/vaccines.htm\" target=\"_blank\">",
"          www.fda.gov/cber/vaccines.htm",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides information about vaccines licensed in the United States and information about vaccine safety, including consumer updates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         National Institute of Allergy and Infectious Diseases",
"        </p>",
"        <p>",
"         <a href=\"file://www3.niaid.nih.gov/topics/vaccines/\" target=\"_blank\">",
"          www3.niaid.nih.gov/topics/vaccines/",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Provides information about understanding vaccines, community immunity, and vaccine research",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Miscellaneous",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <p>",
"         Baby 411",
"        </p>",
"        <p>",
"         <a href=\"file://www.windsorpeak.com/baby411/\" target=\"_blank\">",
"          www.windsorpeak.com/baby411/",
"         </a>",
"        </p>",
"       </td>",
"       <td>",
"        Link to free excerpt on vaccines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Books",
"       </td>",
"       <td class=\"subtitle2_left\">",
"        Publisher",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Immunizations and Infectious Diseases: An Informed Parent's Guide",
"        </em>",
"        by Fisher MC",
"       </td>",
"       <td>",
"        American Academy of Pediatrics, Elk Grove Village, IL 2005",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Vaccinating Your Child: Questions and Answers for the Concerned Parent",
"        </em>",
"        by Humiston SG, Good C",
"       </td>",
"       <td>",
"        Peachtree Publishers, Atlanta 2000",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Do Vaccines Cause That? A guide for Evaluating Vaccine Safety Concerns",
"        </em>",
"        by Myers MG, Pineda D",
"       </td>",
"       <td>",
"        Immunizations for Public Health 2008",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Vaccines: What Every Parent Should Know",
"        </em>",
"        by Offit PA, Bell LM",
"       </td>",
"       <td>",
"        IDG Books, New York 1999",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <em>",
"         Autism's False Prophets: bad science, risky medicine, and the search for a cure",
"        </em>",
"        by Offit PA",
"       </td>",
"       <td>",
"        Columbia University Press, New York 2008",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from:",
"     <br/>",
"     <ol>",
"      <li>",
"       American Academy of Pediatrics. Sources of vaccine information. In: Red Book: 2012 Report of the Committee on Infectious Diseases, 29th ed, Pickering LK (Ed), American Academy of Pediatrics, Elk Grove Village, IL 2012. p.3.",
"      </li>",
"      <li>",
"       Pickering LK, Baker CJ, Freed GL, et al. Immunization programs for infants, children, adolescents, and adults: Clinical practice guidelines by the Infectious Diseases Society of America. Clin Infect Dis 2009; 49:817.",
"      </li>",
"     </ol>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
